import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';


function Alert() {
  const [disaster_type, setDestination] = useState('');
  const [address, setAddress] = useState('');
  const [date, setDate] = useState('');
  const [amount_of_people, setNumberOfPeople] = useState('');
  const [first_name, setFirstName] = useState('');
  const [last_name, setLastName] = useState('');
  const [phone_number, setPhoneNumber] = useState('');

  const navigate=useNavigate();


  
  const url = "http://localhost:8080/trip/add";

  const handleSubmit = async (e) => {
    e.preventDefault();
    try{
    await axios.post(url, {
      disaster_type,
      address,
      date,
      amount_of_people,
      first_name,
      last_name,
      phone_number,
    });

    navigate ("/manage");
  } catch(error){
        console.error("Error adding Disaster:",error);
      }
    };


  const handleCancel = () => {
  
    setDestination("");
    setAddress("");
    setDate("");
    setNumberOfPeople("");
    setFirstName("");
    setLastName("");
    setPhoneNumber("");
  };

  return (
    <div className="container mx-auto mt-10">
      <form onSubmit={handleSubmit} className="bg-blue-100 p-2 rounded shadow-lg">
        <h2 className="text-3xl font-bold mb-4">Enter the Trip details</h2>

        <div className="mb-4">
          <label htmlFor="destination" className="block text-gray-700 text-sm font-bold mb-2">Destination</label>
          <select
            id="destination"
            className="block w-full p-2 border rounded"
            value={package_type}
            onChange={(e) => setDestination(e.target.value)}
          >
            <option value="Sigiriya">Sigiriya</option>
            <option value="Ella">Ella</option>
            <option value="Nuwara Eliya">Nuwara Eliya</option>
            <option value="Galle">Galle</option>
            <option value="Kandy">Kandy</option>
            <option value="Arugam Bay">Arugam Bay</option>
            <option value="Colombo">Colombo</option>
          </select>
        </div>

        <div className="flex mb-4">
          <div className="mr-2">
            <label htmlFor="checkInDate" className="block text-gray-700 text-sm font-bold mb-2">Check-In</label>
            <input
              type="date"
              id="checkInDate"
              className="block w-full p-2 border rounded"
              value={check_InDate}
              onChange={(e) => setCheckInDate(e.target.value)}
            />
          </div>
          <div className="ml-2">
            <label htmlFor="checkOutDate" className="block text-gray-700 text-sm font-bold mb-2">Check-Out</label>
            <input
              type="date"
              id="checkOutDate"
              className="block w-full p-2 border rounded"
              value={check_OutDate}
              onChange={(e) => setCheckOutDate(e.target.value)}
            />
          </div>
        </div>

        <div className="mb-4">
          <label htmlFor="peopleCount" className="block text-gray-700 text-sm font-bold mb-2">Number Of Person</label>
          <input
            type="text"
            placeholder=''
            id="peopleCount"
            className="block w-full p-2 border rounded"
            value={people_count}
            onChange={(e) => setNumberOfPerson(e.target.value)}
          />
        </div>

        <div className="mb-4">
          <label htmlFor="firstName" className="block text-gray-700 text-sm font-bold mb-2">First Name</label>
          <input
            type="text"
            placeholder=''
            id="firstName"
            className="block w-full p-2 border rounded"
            value={first_name}
            onChange={(e) => setFirstName(e.target.value)}
          />
        </div>

        <div className="mb-4">
          <label htmlFor="lastName" className="block text-gray-700 text-sm font-bold mb-2">Last Name</label>
          <input
            type="text"
            placeholder=''
            id="lastName"
            className="block w-full p-2 border rounded"
            value={last_name}
            onChange={(e) => setLastName(e.target.value)}
          />
        </div>

        <div className="mb-4">
          <label htmlFor="phoneNumber" className="block text-gray-700 text-sm font-bold mb-2">Phone Number</label>
          <input
            type="text"
            id="phoneNumber"
            placeholder=''
            className="block w-full p-2 border rounded"
            value={phone_number}
            onChange={(e) => setPhoneNumber(e.target.value)}
          />
        </div>

        <button type="submit"  className="bg-blue-500 text-white p-2 rounded hover:bg-blue-900">Submit</button>
        <button type="button" onClick={handleCancel } className="bg-gray-500 text-white p-2 rounded ml-2 hover:bg-gray-600">Cancel</button>
      </form>
    </div>
  );
}

export default Alert;
